import { spacing, palette } from '@material-ui/system'
import Box from '@material-ui/core/Box'

const Dev = props => {

  async function hello() {
    setTimeout(1000)
    return "hello"
  }

  return (
    <Box>
      <h1>{hello()}</h1>
    </Box>
  )
}

export default Dev
